import Cookies from "react-cookies";
// import {IsJsonString} from "util/Utils";

export default class SessionStorage {

    static get(key) {
        const value = Cookies.load(key);
        return value;
    }

    static set(key, value, options = {}) {
        console.log(key)
        console.log(value)
        console.log(options)
        Cookies.save(key, value, options);
    }

    static remove(key, options = {}) {
        return Cookies.remove(key, options);
    }

    static getAll() {
        return Cookies.load();
    }
}
